import React from 'react';
import  './Navbar.css';
import  {persib} from '../img/Persib.png';

const Navbar = () => {
  return (
    <nav class="navbar navbar-light bg-primary">
      <div class="container">
        <a class="navbar-brand" href="#">
          <img src={persib} alt="" width="30" height="24"/>
        </a>
      </div>
    </nav>
  )
}

export default Navbar
